static inline __attribute__((no_instrument_function)) int ac97_is_audio(struct snd_ac97 * ac97)
{
 return (ac97->scaps & (1<<0));
}
static inline __attribute__((no_instrument_function)) int ac97_is_modem(struct snd_ac97 * ac97)
{
 return (ac97->scaps & (1<<1));
}
static inline __attribute__((no_instrument_function)) int ac97_is_rev22(struct snd_ac97 * ac97)
{
 return (ac97->ext_id & 0x0c00) >= 0x0400;
}
static inline __attribute__((no_instrument_function)) int ac97_can_amap(struct snd_ac97 * ac97)
{
 return (ac97->ext_id & 0x0200) != 0;
}
static inline __attribute__((no_instrument_function)) int ac97_can_spdif(struct snd_ac97 * ac97)
{
 return (ac97->ext_id & 0x0004) != 0;
}



